INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (110501, 1, "2030/12/17 14:59:59", 24015, 0.0, 0.0, 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", 24, 4, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 10021);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (110501, 2, "2030/12/17 14:59:59", 24016, 4.0, 0.0, 1, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", 24, 4, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 10021);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (110501, 3, "2030/12/17 14:59:59", 24017, 0.0, 0.0, 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", 24, 4, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 10021);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (110501, 4, "2030/12/17 14:59:59", 24018, 5.2, 0.0, 2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", 24, 1, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 10021);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (110501, 5, "2030/12/17 14:59:59", 24019, 4.2, 0.0, 6, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", 24, 5, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 10021);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (110501, 6, "2030/12/17 14:59:59", 24020, 0.0, 0.0, 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", 24, 2, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 10021);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (110501, 7, "2030/12/17 14:59:59", 24021, 6.4, 0.0, 6, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", 24, 1, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 10021);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (110501, 8, "2030/12/17 14:59:59", 24022, 0.0, 0.0, 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", 24, 2, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 10021);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (110501, 9, "2030/12/17 14:59:59", 24023, 10.08, 0.0, 3, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", 24, 6, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 10021);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (110501, 10, "2030/12/17 14:59:59", 24024, 5.0, 0.0, 2, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", 24, 1, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 10021);
INSERT INTO `v1_8f9199e357093312a006a129654df3e8099ec24ff4976fd5031b575b0d97de83` VALUES (110501, 11, "2030/12/17 14:59:59", 24025, 0.0, 0.0, 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", 24, 2, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", 10021);
